import React from "react";
import CardList from "../../Components/CardList/CardList.component.jsx";

const HomePage = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <CardList />
    </div>
  );
};

export default HomePage;
